import React from "react";
import { MDBBtn, MDBCol, MDBContainer, MDBRow } from "mdbreact";

function TaskList({ tasks }) {
  const task = tasks.map(task => (
    <li key={task.number}>
      {task.name} {task.number}
    </li>
  ));
  return (
    <MDBContainer>
      <MDBCol className="text-center">
        <ul>{task}</ul>
      </MDBCol>
    </MDBContainer>
  );
}
export default TaskList;
